import React from 'react';

import { Image } from 'react-native';

const WelcomeLogo = () => {
    return (
        <Image
            source={require('../../../assets/Background.jpg')}
            style={{
                position: 'absolute',
                top: -70,
                marginLeft: 30,
                width: 420,
                height: 950,
            }}
        />
    );
};

export default WelcomeLogo;
